import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';

const ColoredButton = (props) => (
    <Button variant="primary" backgroundColor={props.color || 'red'}>{props.title}</Button>
);

const ProjectCard = (props) => (
    <Col sm={6}>
                <Card>
                  <Card.Img variant="top" src={props.image || 'https://cdn1.thr.com/sites/default/files/imagecache/landscape_928x523/2019/11/the_mandalorian_still_embed.jpg'} />
                  <Card.Body>
                    <Card.Title>{props.title || 'Card Title' }</Card.Title>
                    <Card.Text>
                      {props.description || 'A sample description.' }
                    </Card.Text>
                    <Button variant="primary">Go somewhere</Button>
                  </Card.Body>
                </Card>
            </Col>
);

export default {ProjectCard, ColoredButton};
